import React from 'react';
import {
  MDBInput,
  MDBCol,
  MDBRow,
  MDBCheckbox,
  MDBBtn,
  MDBIcon,
  MDBTextArea
} from 'mdb-react-ui-kit';
import Container from 'react-bootstrap/Container';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';

// <MDBInput id='form3Example1' label='First name' />
// <MDBIcon fab icon='facebook-f' />
export default function Contact() {
  return (
    <section className ='contact-section d-flex align-items-center justify-content-center ' >
        <Container fluid className='align-items-center justify-content-center' >

          <Row>
            <Col md={5} className='align-self-center align-items-center justify-content-center'>

            <h1>Contact Me !</h1>
            <form>
            <MDBInput className ='form-input' label='First name'/><br />
            <MDBInput className ='form-input' label='Last name' /><br />
            <MDBInput className='form-input' type='email' label='Email address' /><br />
            <MDBTextArea  className='form-input' label='message' rows={4}></MDBTextArea>
            </form>
            </Col>
            
            <Col>
              <Row>
              <MDBIcon fab icon="twitter" style = {{fill:'cyan'}} />
              </Row>
            </Col>
          </Row>
          

          

        </Container>
    </section>
   
  );
}
